import styled from "styled-components";

export const Container = styled.div`
    position: absolute;
    width: 375px;
    height: 677px;
    left: 0px;
    top: 0px;   
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius: 40px 40px 0px 0px;
`;

export const Container2 = styled.div`
    position: absolute;
    width: 295px;
    height: 68px;
    left: 40px;
    top: 589px;
    background: #FFFFFF;
    opacity: 0.8;
    border-radius: 99px;
`;

export const Container3 = styled.div`
    position: absolute;
    width: 48px;
    height: 48px;
    left: 164px;
    top: 599px;
    background: linear-gradient(274.42deg, #C58BF2 0%, #EEA4CE 124.45%);
    border-radius: 40px;
`;

export const Container4 = styled.div`
    position: absolute;
    width: 67.5px;
    height: 65px;
    left: 30px;
    top: 707px;
    background: #F7F8F8;
    border-radius: 12px;
`;

export const Container5 = styled.div`
    position: absolute;
    width: 67.5px;
    height: 65px;
    left: 117px;
    top: 707px;
    background: #DDDADA;
    opacity: 0.1;
    border: 1.2px solid #7B6F72;
    box-sizing: border-box;
    border-radius: 12px;
`;

export const Container6 = styled.div`
    position: absolute;
    width: 67.5px;
    height: 65px;
    left: 195px;
    top: 707px;
    background: #DDDADA;
    opacity: 0.1;
    border: 0.5px solid #DDDADA;
    box-sizing: border-box;
    border-radius: 12px;
`;

export const Container7 = styled.div`
    position: absolute;
    width: 67.5px;
    height: 65px;
    left: 278px;
    top: 707px;
    background: #DDDADA;
    opacity: 0.1;
    border: 0.5px solid #DDDADA;
    box-sizing: border-box;
    border-radius: 12px;
`;
